import React from 'react';
import {AllUsers} from './UsersAll';
import {SingleUser} from './SingleUser';
import { User } from '../models/User';


interface IAppState {
    Onemembers: User[]|any;
  userid : any;
  }

export default class users extends React.Component {


    render(){
        return(
            <>
            <span className="show individual">individual</span>
            <div className="wrapmein">
               <SingleUser />
               </div>
            <span className="show allusers">all users</span>
            <div className="wrapmein">
               <AllUsers />
               </div>

            </>

        )
    }
}
